function Posts() {

  const [posts, setPosts] = useState([])

  useEffect(() => {
    fetch('http://127.0.0.1:8000/api/books')
      .then(response => response.json())
      .then(posts => setPosts(posts))
  },[])

  return (
    <div>
      <h2>Test Posts</h2>

    </div>
  )
}

export default Posts
